"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[4382],{5607:(o,e,t)=>{t.r(e),t.d(e,{assets:()=>l,contentTitle:()=>n,default:()=>g,frontMatter:()=>r,metadata:()=>i,toc:()=>c});var a=t(4848),s=t(8453);const r={title:"Como gerar relat\xf3rios de delivery?"},n=void 0,i={id:"relatorios/como-gerar-relatorios-de-delivery-",title:"Como gerar relat\xf3rios de delivery?",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/relatorios/como-gerar-relatorios-de-delivery-.mdx",sourceDirName:"relatorios",slug:"/relatorios/como-gerar-relatorios-de-delivery-",permalink:"/ajudafacitysistemas/docs/relatorios/como-gerar-relatorios-de-delivery-",draft:!1,unlisted:!1,editUrl:"https://github.com/ajudafacity/ajudafacitysistemas/edit/main/docs/relatorios/como-gerar-relatorios-de-delivery-.mdx",tags:[],version:"current",frontMatter:{title:"Como gerar relat\xf3rios de delivery?"},sidebar:"tutorialSidebar",previous:{title:"Como gerar relat\xf3rios de comiss\xe3o/gar\xe7om?",permalink:"/ajudafacitysistemas/docs/relatorios/como-gerar-relatorios-de-comissao-garcom-"},next:{title:"Como gerar relat\xf3rios de entradas por mat\xe9ria prima?",permalink:"/ajudafacitysistemas/docs/relatorios/como-gerar-relatorios-de-entradas-por-materia-prima-"}},l={},c=[];function p(o){return(0,a.jsx)(a.Fragment,{children:(0,a.jsx)(a.Fragment,{children:(0,a.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p class="has-small-font-size">Como gerar relat\xf3rios de<strong> delivery: </strong>um guia passo a passo</p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 1: </strong>Abra o Facity Controle em seu computador</p>\n\n\n\n<p class="has-small-font-size">A primeira coisa que voc\xea precisa fazer \xe9 acessar o <strong>Facity Controle</strong> em seu computador. Esse \xe9 o software que voc\xea usar\xe1 para gerar seus relat\xf3rios. Certifique-se de ter o <strong>nome da empresa</strong>,<strong> login</strong> e <strong>senha</strong> em m\xe3os. \xc9 importante lembrar que todas as informa\xe7\xf5es devem ser inseridas em <em>letras min\xfasculas</em>.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img loading="lazy" decoding="async" src="http://blog.facity.com.br/wp-content/uploads/2022/11/image-45.png" alt="" class="wp-image-890" width="1027" height="624" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/image-45.png 900w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-45-300x182.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-45-768x467.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-45-720x438.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 2:</strong> Acesse <strong>&#8220;Relat\xf3rios</strong>&#8220;.</p>\n\n\n\n<p class="has-small-font-size">Depois de fazer login, clique na op\xe7\xe3o <strong>&#8220;Relat\xf3rios&#8221;</strong> no menu lateral esquerdo. Em seguida, clique na op\xe7\xe3o <strong>&#8220;Delivery&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-large"><img loading="lazy" decoding="async" width="1024" height="486" src="http://blog.facity.com.br/wp-content/uploads/2022/11/image-46-1024x486.png" alt="" class="wp-image-891" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/image-46-1024x486.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-46-300x142.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-46-768x364.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-46-720x342.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-46.png 1307w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<figure class="wp-block-image size-large"><img loading="lazy" decoding="async" width="1024" height="506" src="http://blog.facity.com.br/wp-content/uploads/2022/11/14_11_2022-19_47_38-1024x506.png" alt="" class="wp-image-894" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/14_11_2022-19_47_38-1024x506.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/14_11_2022-19_47_38-300x148.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/14_11_2022-19_47_38-768x380.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/14_11_2022-19_47_38-720x356.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/14_11_2022-19_47_38.png 1264w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 3: </strong>Defina um per\xedodo de tempo para o relat\xf3rio</p>\n\n\n\n<p class="has-small-font-size">Agora \xe9 hora de selecionar um per\xedodo de tempo para o seu relat\xf3rio. Escolha uma <strong>data inicial</strong> e uma <strong>data final</strong>. \xc9 importante lembrar que s\xf3 \xe9 poss\xedvel filtrar datas em um per\xedodo de 30 dias entre cada uma. Se voc\xea quiser uma busca mais espec\xedfica, pode usar a barra de pesquisa para procurar por nomes de clientes.</p>\n\n\n\n<p></p>\n\n\n\n<figure class="wp-block-image size-large"><img loading="lazy" decoding="async" width="1024" height="547" src="http://blog.facity.com.br/wp-content/uploads/2022/11/dataedt-1024x547.png" alt="" class="wp-image-895" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/dataedt-1024x547.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/dataedt-300x160.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/dataedt-768x411.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/dataedt-720x385.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/dataedt.png 1188w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 4:</strong> Selecione o motoboy</p>\n\n\n\n<p class="has-small-font-size">Na se\xe7\xe3o <strong>&#8220;MOTOBOY&#8221;</strong> (Entregador), voc\xea pode selecionar um ou todos os seus entregadores. Isso permitir\xe1 que voc\xea obtenha uma vis\xe3o geral do desempenho de cada um.</p>\n\n\n\n<figure class="wp-block-image size-large"><img loading="lazy" decoding="async" width="1024" height="547" src="http://blog.facity.com.br/wp-content/uploads/2022/11/filtrar-1024x547.png" alt="" class="wp-image-897" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/filtrar-1024x547.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/filtrar-300x160.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/filtrar-768x411.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/filtrar-720x385.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/filtrar.png 1188w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 5: </strong>Clique em <strong>&#8220;Filtrar&#8221;</strong> para gerar o relat\xf3rio</p>\n\n\n\n<p class="has-small-font-size">Depois de selecionar as datas e o entregador, clique no bot\xe3o<strong> &#8220;Filtrar&#8221; </strong>para gerar o relat\xf3rio.</p>\n\n\n\n<p class="has-small-font-size">Seguindo os passos acima, voc\xea pode obter informa\xe7\xf5es sobre o desempenho de sua equipe e tomar decis\xf5es informadas para melhorar seus resultados.</p>\n\n'}})})})}function g(o={}){const{wrapper:e}={...(0,s.R)(),...o.components};return e?(0,a.jsx)(e,{...o,children:(0,a.jsx)(p,{...o})}):p()}},8453:(o,e,t)=>{t.d(e,{R:()=>n,x:()=>i});var a=t(6540);const s={},r=a.createContext(s);function n(o){const e=a.useContext(r);return a.useMemo((function(){return"function"==typeof o?o(e):{...e,...o}}),[e,o])}function i(o){let e;return e=o.disableParentContext?"function"==typeof o.components?o.components(s):o.components||s:n(o.components),a.createElement(r.Provider,{value:e},o.children)}}}]);